import './App.css';
import Footer from './components/Footer';
import Header from './components/Header';
import Home from './pages/Home';
import Landing from './pages/Landing';
import Watchhistory from './pages/Watchhistory';


function App() {
  return (
    <div className="App">
     <Header/>
     <Landing/><Home/>

     <Watchhistory/>
     <Footer/>
    </div>
  );
}

export default App;
